INSERT INTO `paginas` (`id_pagina`, `texto_pagina`, `nome_pagina`, `url_pagina`) VALUES
(1, '<p><strong><img alt=\"\" src=\"http://localhost/blog/assets/uploads/download3.jpg\" style=\"float:left; height:183px; margin:10px; width:275px\" />Lorem Ipsum</strong>&nbsp;is simply dummy text of the printing and typesetting industry.</p>\r\n\r\n<p>Lorem Ipsum has been the industry&#39;s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book.</p>\r\n\r\n<p>It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged.</p>\r\n\r\n<p>It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>\r\n', 'Sobre Nós', 'sobre-nos'),
(2, '<p><img alt=\"\" src=\"http://localhost/blog/assets/uploads/slides/marc-zimmer-yktwU2t1qHA-unsplash.jpg\" style=\"height:400px; margin:10px; width:600px\" /><img alt=\"\" src=\"http://blogcurso.tk/assets/uploads/artigo2.jpg\" style=\"height:349px; margin:10px; width:600px\" /></p>\r\n\r\n<h2><strong>Crie voc&ecirc; mesmo seu Blog com design Responsivo.</strong></h2>\r\n\r\n<p>Utilizando o Framework Bootstrap e Codeigniter voc&ecirc; consegue um resultado espetacular!</p>\r\n\r\n<p>Um design limpo, atraente e&nbsp;totalmente responsivo, de acordo com as melhores t&eacute;cnicas utilizadas atualmente no mercado.</p>\r\n\r\n<h2><strong>Codeigniter, Framework PHP</strong></h2>\r\n\r\n<p>O codeigniter &eacute; um poderoso framework PHP que permite a cria&ccedil;&atilde;o de diversos sistemas, desde os mais simples aos mais robustos.</p>\r\n\r\n<p>Leve e de simples configura&ccedil;&atilde;o em poucos dias voc&ecirc; consegue resultados impressionantes.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', 'Crie seu Blog', 'crie-seu-blog');
